import { TITLE } from './types'

 const initialState = {
   title: "123",
 }

export const titleReducer = (state=initialState, action) => {
  console.log('reducer>', action)
  console.log('STATE',state)
  switch (action.type) {
    case TITLE:
      return {
        ...state,
        title: state.title,
      }
    default:
      return state
  }
}
